import { TaskPreview } from '../TaskPreview/TaskPreview'
import './TasksList.scss'

export const TasksList = (props) => {

    return (
        <div className="tasks-list">
            {props.checkList.tasks.map((task) =>
                <TaskPreview task={task}/>
            )}
        </div>
    )
}
